export default function Contact() {
    return (
        <div>
            <Header />
            <div className="contact">
                <h1>Co<span>nta</span>ct</h1>
                <h2>Come back soon for updates regarding <strong>Spring 2021 rush!</strong>
                </h2>
            </div>
            <Footer />            
        </div>
    )
}
